var count = 1000;
var splitcount = Math.ceil(12000 / count);

var xAxisdata = [];
for (var i = 0; i < count; i++) {
    var t = +(0.002 * i).toFixed(1) + "s";
    xAxisdata.push(t);
}

var getData = function (startid) {
    var temp = [];
    for (var i = 0; i < count; i++) {
        var item = -(data[startid * count + i] / 4530);
        temp.push(item);
    }

    return temp;
};

var colors = ["#ef0a25"];
var topOffset = 1; //1%
var height = ((100 - topOffset * 2) / splitcount).toFixed(4); //16%

var grids = [];
var xAxis = [];
var yAxis = [];
var series = [];

var getGridById = function (id) {
    var top = (topOffset + height * id).toFixed(4) + "%";
    return {
        top: top,
        bottom: 0,
        left: "2%",
        right: "0%",
        height: height + "%",
        show: true,
        borderColor: "#666",
    };
};

var grids = function () {
    var temp = [];
    for (var i = 0; i < splitcount; i++) {
        var item = getGridById(i);
        temp.push(item);
    }
    return temp;
};

var getXAxisById = function (id) {
    return {
        type: "category",
        gridIndex: id,
        data: xAxisdata,
        axisLine: {
            onZero: false,
        },
        axisLabel: {
            interval: 100,
        },
        axisTick: {
            alignWithLabel: true,
            show: false,
        },
        axisLabel: {
            show: false,
        },
        splitLine: {
            show: true,
            alignWithLabel: true,
        },
        splitArea: {},
        boundaryGap: true,
    };
};

var xAxis = function () {
    var temp = [];
    for (var i = 0; i < splitcount; i++) {
        var item = getXAxisById(i);
        temp.push(item);
    }
    return temp;
};

var getYAxisById = function (id) {
    return {
        type: "value",
        // splitNumber: 15,
        max: 0.5,
        min: -0.5,
        axisTick: {
            show: false,
        },
        axisLabel: {
            // formatter: function(value, index) {
            //     return '';
            // }
        },
        gridIndex: id,
    };
};

var yAxis = function () {
    var temp = [];
    for (var i = 0; i < splitcount; i++) {
        var item = getYAxisById(i);
        temp.push(item);
    }
    return temp;
};

var getSeriesById = function (id) {
    return {
        type: "line",
        xAxisIndex: id,
        lineStyle: {
            width: 1,
        },
        data: getData(id),
        animationDuration: 2000,
        animationThreshold: 10000,
        yAxisIndex: id,
        symbol: "none",
        smooth: true,
    };
};
var series = function () {
    var temp = [];
    for (var i = 0; i < splitcount; i++) {
        var item = getSeriesById(i);
        temp.push(item);
    }
    return temp;
};
option = {
    color: colors,
    grid: grids(),
    xAxis: xAxis(),
    yAxis: yAxis(),
    series: series(),
};
myChart.setOption(option);
